import{_ as l,v as i,b as t,R as o}from"./chunks/framework.4f207390.js";const p=JSON.parse('{"title":"2021 年 4季度","description":"","frontmatter":{},"headers":[],"relativePath":"其他/工作/述职/2021年4季度总结.md","filePath":"其他/工作/述职/2021年4季度总结.md","lastUpdated":1673501935000}'),r={name:"其他/工作/述职/2021年4季度总结.md"},n=o('<h1 id="_2021-年-4季度" tabindex="-1">2021 年 4季度 <a class="header-anchor" href="#_2021-年-4季度" aria-label="Permalink to &quot;2021 年 4季度&quot;">​</a></h1><h2 id="复盘与总结" tabindex="-1">复盘与总结 <a class="header-anchor" href="#复盘与总结" aria-label="Permalink to &quot;复盘与总结&quot;">​</a></h2><h3 id="需求" tabindex="-1">需求 <a class="header-anchor" href="#需求" aria-label="Permalink to &quot;需求&quot;">​</a></h3><ul><li>原创官网共处理 <strong>22</strong> 个需求，发版 <strong>12</strong> 次；</li><li>整装官网共处理 <strong>7</strong> 个需求，发版 <strong>7</strong> 次；</li><li>原创微信小程序共处理 <strong>18</strong>个需求，发版 <strong>14</strong> 次；</li><li>整装小程序共处理 <strong>12</strong> 个需求，发版<strong>14</strong> 次；</li><li>共计 <strong>59</strong> 个需求， 需求保质保量按时达成， 发版 <strong>47</strong> 次，发版成功率 <strong>100%</strong> ， 阻断性BUG <strong>0</strong> 个；其中原创微信小程序，全国 <strong>23</strong> 个城市进行统一发版 <strong>4</strong> 次，<strong>单次</strong>发版 <strong>2小时 / 人</strong>，<strong>4</strong> 次发版预计消耗 <strong>1 天 / 人</strong> ；搭建了<strong>CI一键发版工具</strong>，使用工具发版则为 <strong>3分钟 / 人</strong>，<strong>4</strong> 次发版预计消耗 <strong>12 分钟 / 人</strong> 。</li></ul><ol><li>界面改版 <ul><li>原创微信小程序首页改版</li><li>原创百度小程序首页改版</li><li>原创字节小程序功能换新，与微信小程序保持一致</li><li>整装微信小程序首页、我的页面改版，<strong>22</strong>个子页面图片、颜色换新，统一风格</li></ul></li><li>流畅度提升、打开速度、访问速度提升</li></ol><h3 id="专题" tabindex="-1">专题 <a class="header-anchor" href="#专题" aria-label="Permalink to &quot;专题&quot;">​</a></h3><ul><li><strong>工作内容</strong><ul><li>完善专题页项目体系，梳理专题<strong>排期表</strong>，排期后<strong>在全国专题对接群内进行公示</strong>，公开透明专题排期，减少排期沟通。</li><li>收集全国线上对接群的问题，生成<strong>常见问题解决方法清单</strong>， 并在公示专题排期时附带，为分公司提供可参考案例。</li><li>把控专题开发周期和开发进度，达到保质保量的交付效果</li></ul></li><li><strong>结果</strong>：效果明显，有效解决群内重复问题，群内无大批量问题反馈；各城市也不会因为不清楚专题排期而重复询问，井然有序的模式提高了工作效率</li></ul><h2 id="核心问题及解决措施-项目推进" tabindex="-1">核心问题及解决措施（项目推进） <a class="header-anchor" href="#核心问题及解决措施-项目推进" aria-label="Permalink to &quot;核心问题及解决措施（项目推进）&quot;">​</a></h2><ul><li>持续推进原创、整装的专题、官网、小程序业务线，参加需求评审会给出专业性建议，评审后进行工期评估，给出技术方案、预防风险及因对措施。</li><li>解决项目遇到的技术难题；热心解答其他同事提出的专业问题；在专业方面辅导同事，帮助提升技能和成长</li><li><strong>规范文档沉淀</strong>：梳理输出专题技术规范、前端编码规范，提高团队协作效率, 便于后期优化维护</li><li><strong>项目文档沉淀</strong>：梳理输出原创小程序、整装小程序、APP内嵌H5项目 <ul><li>项目简介，软件定位，软件的基本功能</li><li>项目使用的技术栈，简要的使用说明</li><li>运行代码的方法：安装环境，启动命令</li><li>代码目录结构说明，软件的基本原理</li><li>项目常见问题说明，整合记录了部署过程中可能会遇到的问题和解决办法。</li><li>git 代码分支说明</li></ul></li></ul><h2 id="个人swot分析" tabindex="-1">个人swot分析 <a class="header-anchor" href="#个人swot分析" aria-label="Permalink to &quot;个人swot分析&quot;">​</a></h2><ul><li><strong>优势</strong>强：Strength <ul><li>熟练掌握前端技术，能够在前端领域独挡一面；</li><li>对后端技术有了解，能顺畅地与后端进行协作，进行方案制定、接口调试、性能优化。</li><li>学习能力比较强,有自主学习习惯</li></ul></li><li><strong>劣势</strong>弱：Weakness <ul><li>工作学习保守，冒险精神不够，太理性，对非前端技术领域漠不关心，自我乏味枯燥、单调；</li><li>组织管理人员能力和经验欠缺。</li></ul></li><li><strong>机会</strong>提高：Opportunity <ul><li>公司的企业文化是引人积极向上的，激发员工潜能，同时也是一个很好的平台，让员工不断提升自我，个人成就企业，企业成就个人。 <ol><li>在工作内有大展身手的空间</li><li>通过技术给公司带来持续的竞争力</li><li>为将来的发展作铺垫，为公司业务做出更高效的产品</li></ol></li></ul></li><li><strong>威胁</strong>消除：Threat <ul><li>由于经常和机器打交道，竞争意识薄弱；领导力差。</li><li>主动利用环境资源，用知识武装自己，善于发现机会，勇往直前，征服自己，展现魅力</li></ul></li></ul><h2 id="展望与规划" tabindex="-1">展望与规划 <a class="header-anchor" href="#展望与规划" aria-label="Permalink to &quot;展望与规划&quot;">​</a></h2><h3 id="工作方向" tabindex="-1">工作方向 <a class="header-anchor" href="#工作方向" aria-label="Permalink to &quot;工作方向&quot;">​</a></h3><ol><li>保障前端需求的流畅开发</li><li>每月开展一次技术分享，营造团队技术气氛，与团队共进步</li><li>提升线索数量 <ul><li><strong>访问速度</strong>：目前原创小程序已进行拆包，总包由 <strong>2.1MB</strong> 压缩至 <strong>1.4MB</strong>，体积降低了<strong>66%</strong>，性能评估报告由 <strong>43%</strong> 提升至 <strong>96%</strong>，<strong>首次</strong> 打开访问速度，由 <strong>3~5</strong> 秒减少至 <strong>1~2</strong> 秒，<strong>减少用户等待时间，有效提升客户转化</strong>。</li><li><strong>用户体验</strong>：与产品、设计师相互配合，提高业务功能和设计图质量，提升用户使用体验，增强用户沉浸式体验</li><li><strong>稳定性</strong>：目前个人负责的项目需求在线上运行是十分稳定的， 但是生产环境是非常重要，新人开发者出现过上线失败回滚代码的情况，经过复盘进行分析得出原因。目前由我审核其他开发者提交的代码，保证代码质量，并且把控上线环节，严格执行上线前必查项，保持线上的稳定性。</li></ul></li></ol><h3 id="落地规划" tabindex="-1">落地规划 <a class="header-anchor" href="#落地规划" aria-label="Permalink to &quot;落地规划&quot;">​</a></h3><h4 id="一季度-专题页建站工具-调研了一些自建站工具-因为门槛高-要求用户有专业知识-使用场景复杂-而不符合公司的业务场景。" tabindex="-1">一季度：专题页建站工具：调研了一些自建站工具， 因为门槛高，要求用户有专业知识，使用场景复杂，而不符合公司的业务场景。 <a class="header-anchor" href="#一季度-专题页建站工具-调研了一些自建站工具-因为门槛高-要求用户有专业知识-使用场景复杂-而不符合公司的业务场景。" aria-label="Permalink to &quot;一季度：专题页建站工具：调研了一些自建站工具， 因为门槛高，要求用户有专业知识，使用场景复杂，而不符合公司的业务场景。&quot;">​</a></h4><ol><li>底层框架搭建，基础功能：组件拖拽、缩放</li><li>营销组件：交互动画、轮播图、报名获客表单、IM通讯工具美恰、埋点、TDK。</li><li>用户自定义组件库、素材库；</li><li>自建站工具在线培训；设立反馈意见表单。</li></ol><h4 id="二季度-用户体验-内容力提升" tabindex="-1">二季度：用户体验 + 内容力提升 <a class="header-anchor" href="#二季度-用户体验-内容力提升" aria-label="Permalink to &quot;二季度：用户体验 + 内容力提升&quot;">​</a></h4><ol><li><p>日常需求迭代</p></li><li><p>小程序</p><ul><li><p>进行拆包，提升访问速度</p></li><li><p>主要获客页面优化，缩短用户报名路径，优化填写手机号报名方式，场景更换一键授权登录，展现形式焕新（报价、案例、设计师、门店列表、风格测试），逐一优化上线</p></li><li><p>整装业务内容整合，页面视觉、细节风格统一</p></li></ul></li><li><p>逐步优化完善专题页建站工具，根据意见表单进行改进、新增功能</p></li><li><p>自建站工具培训</p></li></ol><h4 id="三季度-中台" tabindex="-1">三季度：中台 <a class="header-anchor" href="#三季度-中台" aria-label="Permalink to &quot;三季度：中台&quot;">​</a></h4><ol><li>整合现有后台系统，完成登录鉴权</li><li>日常需求迭代</li><li>优化原创后台系统模块（文章管理、案例中心），优化操作逻辑，提升效率</li><li>使用规范工具统一 <strong>git</strong> 代码提交信息，<strong>明确提交代码意图</strong></li><li>使用 <strong>eslint</strong> 工具规范代码风格，<strong>提高多人协作效率</strong></li><li>打通中台对接的子系统，逐步处理原创、整装、官网后台小程序项目时进行代码重构优化</li></ol><h4 id="四季度-中台" tabindex="-1">四季度：中台 <a class="header-anchor" href="#四季度-中台" aria-label="Permalink to &quot;四季度：中台&quot;">​</a></h4><ol><li>日常需求迭代</li><li>完善监控报警系统，快速定位发现线上问题。</li><li>根据性能报告分析，进行项目优化。</li><li>编写测试用例，保证功能稳定，达到预期结果。</li></ol>',23),s=[n];function a(e,g,h,u,d,c){return i(),t("div",null,s)}const q=l(r,[["render",a]]);export{p as __pageData,q as default};
